import React from 'react'
import Slider from 'react-slick'
const Testimonials = () => {
  return (
    <Slider>
        <div className="testimonial py-4 px-3">
            <p>Lorem ipsum dolor sit amet consectetur, adipisicing elit. Molestiae officiis ipsam quasi enim placeat. Est accusantium expedita aliquid, ratione corrupti qui possimus quia doloremque, adipisci cum nobis quis doloribus consectetur.</p>
        </div>
    </Slider>
  )
}

export default Testimonials
